import React from 'react'
import { Link } from "react-router-dom";
import { Layout, SpanCar, SpanForgot, StyledInput } from './style';

import { Button } from "../../components/Button/index";
import { Input } from "../../components/Input/index";

const Cadastro = () => {
  return (
    <>
      <Layout>
        <h1>Cadastro</h1>
        <span>Preencha os dados</span>
        <Input name='name' control={null} placeholder='Nome'/>
        <Input name='senha' control={null} placeholder='Senha'/>
        <Input name='email' control={null} placeholder='Email'/>
        <Button type="submit" title="Cadastrar" variant="secondary"/>
      </Layout>
    </>
  )
}
export { Cadastro }
